def isreaction(char1, char2):
  #print ("Comparing %s with %s" % (char1, char2))
  if char1.lower() == char2.lower():
    # potential match
    if (char1.isupper() and char2.islower()) or (char1.islower() and char2.isupper()):
      #print("Reacted")
      return True
  #print("Safe")    
  return False

def process(input, headpos):
  inputProcessed = input
    
  while(True):
    # print(inputProcessed)
    char1 = inputProcessed[headpos]
    char2 = inputProcessed[headpos+1]
    if isreaction(char1, char2):
      inputProcessed = inputProcessed[:headpos] + inputProcessed[headpos+2:]
      headpos += 1
    else:
      headpos += 1
   
    if headpos > len(inputProcessed)-2:
      return inputProcessed   
  
def toggle_case(char):
  if char.isupper(): return char.lower()
  if char.islower(): return char.upper()
    
def react(input):
  output = process(input, 0)
  #print("Output %s" % output)
  count = len(output)
  while(True):
    output2 = process(output, 0)
    #print ("Output2 %s" % output2)
    if len(output2) == len(output):
      return len(output)
    else:
      output = output2

def Day5_2(input):
  letters = 'abcdefghijklmnopqrstuvwxyz'
  for letter in letters:
    remove = letter
    inputProcessed = input.replace(remove, "")
    remove = toggle_case(letter)
    inputProcessed = inputProcessed.replace(remove, "")
    print (letter + " - " + str(react(inputProcessed)))
  

  
